	"sap/ushell/plugins/rta-personalize/i18n/i18n_sh.properties":'# Resource bundle for personalize ushell plug-in\n# \n\n# Copyright (c) 2015 SAP SE, All Rights Reserved\n\n#XTIT\nPERSONALIZE_BUTTON_TEXT=Personalizuj aplikaciju\n\n#XTIT\nEND_PERSONALIZE_BUTTON_TEXT=Iza\\u0111i iz na\\u010Dina personalizacije\n\n#XTIT\nERROR_TITLE=Gre\\u0161ka\n\n#XTIT: Application title of the FLP plugin in app descriptor\nAPP_TITLE=Personalizuj FLP plug-in\n\n#XMSG: Error Message when using unsupported Browser\nMSG_UNSUPPORTED_BROWSER=Na\\u017Ealost, va\\u0161 pretra\\u017Eiva\\u010D nije podr\\u017Ean. Koristite Google Chrome ili Microsoft Internet Explorer (verzija 10 ili novija).\n\n#XMSG: Error Message when Personalize UI could not be started\nMSG_STARTUP_FAILED=Na\\u017Ealost, nije mogu\\u0107e pokrenuti na\\u010Din personalizacije.\n\n#XTIT: Title of the ErrorMessage Window\nTIT_UNSUPPORTED_BROWSER=Nepodr\\u017Eani pretra\\u017Eiva\\u010D\n\n#XMSG: Information Message when, after starting, the screen can\'t be personalized\nMSG_STARTUP_NO_OVERLAYS=Na\\u017Ealost, ovaj ekran se ne mo\\u017Ee personalizovati.\n\n#XMSG: Message when we close and save RTA successfully\nSAVE_SUCCESSFUL=Va\\u0161e promene su sa\\u010Duvane.\n\n#XMSG: Message when the wrong Layer is set via URL\nMSG_STARTUP_WRONG_LAYER=Personalizaciju mo\\u017Eete pokrenuti samo u sloju \\u201CUSER\\u201D. Uklonite parametar \\u201Csap-ui-layer\\u201D iz URL.\n\n#XHED: Title of a dialog explaining that personalization will be closed\nHEADER_FLEX_DISABLED=Informacije\n\n#XMSG: Dialog message for flex not enabled\nMSG_FLEX_DISABLED=Za ovu aplikaciju nije omogu\\u0107ena personalizacija. Dodatne informacije pogledajte [ovde](https\\://help.sap.com/viewer/4fc8d03390c342da8a60f8ee387bca1a/latest/en-US/ef97b2485aa34a8890f4d51e5c2b15a8.html).\n',
	"sap/ushell/plugins/rta-personalize/i18n/i18n_sk.properties":'# Resource bundle for personalize ushell plug-in\n# \n\n# Copyright (c) 2015 SAP SE, All Rights Reserved\n\n#XTIT\nPERSONALIZE_BUTTON_TEXT=Personalizova\\u0165 aplik\\u00E1ciu\n\n#XTIT\nEND_PERSONALIZE_BUTTON_TEXT=Opusti\\u0165 re\\u017Eim personaliz\\u00E1cie\n\n#XTIT\nERROR_TITLE=Chyba\n\n#XTIT: Application title of the FLP plugin in app descriptor\nAPP_TITLE=Personalizova\\u0165 plug-in FLP\n\n#XMSG: Error Message when using unsupported Browser\nMSG_UNSUPPORTED_BROWSER=Pou\\u017E\\u00EDvate nepodporovan\\u00FD prehliada\\u010D. Pou\\u017Eite Google Chrome alebo Microsoft Internet Explorer (verzia 10 alebo vy\\u0161\\u0161ia).\n\n#XMSG: Error Message when Personalize UI could not be started\nMSG_STARTUP_FAILED=Re\\u017Eim personaliz\\u00E1cie nie je mo\\u017En\\u00E9 spusti\\u0165.\n\n#XTIT: Title of the ErrorMessage Window\nTIT_UNSUPPORTED_BROWSER=Prehliada\\u010D nie je podporovan\\u00FD\n\n#XMSG: Information Message when, after starting, the screen can\'t be personalized\nMSG_STARTUP_NO_OVERLAYS=T\\u00FAto obrazovku nie je mo\\u017En\\u00E9 personalizova\\u0165.\n\n#XMSG: Message when we close and save RTA successfully\nSAVE_SUCCESSFUL=Va\\u0161e zmeny boli ulo\\u017Een\\u00E9.\n\n#XMSG: Message when the wrong Layer is set via URL\nMSG_STARTUP_WRONG_LAYER=Personaliz\\u00E1ciu nem\\u00F4\\u017Eete spusti\\u0165 vo vrstve inej ako \\u201EPOU\\u017D\\u00CDVATE\\u013D\\u201C. Odstr\\u00E1\\u0148te z adresy URL parameter \\u201Esap-ui-layer\\u201C.\n\n#XHED: Title of a dialog explaining that personalization will be closed\nHEADER_FLEX_DISABLED=Inform\\u00E1cia\n\n#XMSG: Dialog message for flex not enabled\nMSG_FLEX_DISABLED=T\\u00E1to aplik\\u00E1cia nie je aktivovan\\u00E1 pre personaliz\\u00E1ciu. \\u010Eal\\u0161ie inform\\u00E1cie n\\u00E1jdete na str\\u00E1nke [tu](https\\://help.sap.com/viewer/4fc8d03390c342da8a60f8ee387bca1a/latest/en-US/ef97b2485aa34a8890f4d51e5c2b15a8.html).\n',
