	"sap/ushell/plugins/rta-personalize/i18n/i18n_tr.properties":'# Resource bundle for personalize ushell plug-in\n# \n\n# Copyright (c) 2015 SAP SE, All Rights Reserved\n\n#XTIT\nPERSONALIZE_BUTTON_TEXT=Uygulamay\\u0131 ki\\u015Fiselle\\u015Ftir\n\n#XTIT\nEND_PERSONALIZE_BUTTON_TEXT=Ki\\u015Fiselle\\u015Ftirme kipinden \\u00E7\\u0131k\n\n#XTIT\nERROR_TITLE=Hata\n\n#XTIT: Application title of the FLP plugin in app descriptor\nAPP_TITLE=FLP eklentisini ki\\u015Fiselle\\u015Ftir\n\n#XMSG: Error Message when using unsupported Browser\nMSG_UNSUPPORTED_BROWSER=Desteklenmeyen taray\\u0131c\\u0131 kullan\\u0131yorsunuz. Google Chrome veya Microsoft Internet Explorer (versiyon 10 veya daha \\u00FCst\\u00FCn\\u00FC) kullan\\u0131n.\n\n#XMSG: Error Message when Personalize UI could not be started\nMSG_STARTUP_FAILED=Ki\\u015Fiselle\\u015Ftirme kipi ba\\u015Flat\\u0131lam\\u0131yor.\n\n#XTIT: Title of the ErrorMessage Window\nTIT_UNSUPPORTED_BROWSER=Taray\\u0131c\\u0131 desteklenmiyor\n\n#XMSG: Information Message when, after starting, the screen can\'t be personalized\nMSG_STARTUP_NO_OVERLAYS=Bu resim ki\\u015Fiselle\\u015Ftirilebilir de\\u011Fil.\n\n#XMSG: Message when we close and save RTA successfully\nSAVE_SUCCESSFUL=De\\u011Fi\\u015Fiklikleriniz sakland\\u0131.\n\n#XMSG: Message when the wrong Layer is set via URL\nMSG_STARTUP_WRONG_LAYER=Ki\\u015Fiselle\\u015Ftirmeyi "KULLANICI" haricinde bir katmanda ba\\u015Flatamazs\\u0131n\\u0131z. URL\'den "sap-ui-layer" parametresini kald\\u0131r\\u0131n.\n\n#XHED: Title of a dialog explaining that personalization will be closed\nHEADER_FLEX_DISABLED=Bilgiler\n\n#XMSG: Dialog message for flex not enabled\nMSG_FLEX_DISABLED=Bu uygulama ki\\u015Fiselle\\u015Ftirme i\\u00E7in etkinle\\u015Ftirilmedi. Daha fazla bilgi i\\u00E7in [buraya] bak\\u0131n. (https\\://help.sap.com/viewer/4fc8d03390c342da8a60f8ee387bca1a/latest/en-US/ef97b2485aa34a8890f4d51e5c2b15a8.html).\n',
